import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = useState([])

  useEffect(() => {
    const getUsers = async () => {
      const response = await axios('http://0.0.0.0:8080/users?access_token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY2MTBkOTljZDUwZjM0ZmE0MTliZjliNiIsImlhdCI6MTcxMjM4MDM3NiwiZXhwIjoxNzEyMzgzOTc2fQ.QWJiu8tp7bHpLrcHmtcQTo53xujjRYrxRvYH7BpG_LM')
      setUsers(response.data)
    }
    // getUsers() 
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React1212 {users?.[0]?.name}
        </a>
      </header>
    </div>
  );
}

export default App;
